import { AppBar, Toolbar, Typography } from "@mui/material";
import React from "react";
import "./App.css";
import { ThemeProvider } from "./ThemeProvider";

function App() {
  return (
    <ThemeProvider>
      <AppBar>
        <Toolbar>
          <Typography variant="h6">Fake ID</Typography>
        </Toolbar>
      </AppBar>
      <div className="App"></div>
    </ThemeProvider>
  );
}

export default App;
